import React, { useState } from "react";
import axios from "axios";
import styles from "./Register.module.css";

const Register = () => {
  const [formData, setFormData] = useState({
    firstName: "",
    lastName: "",
    email: "",
    phone: "",
    dob: "",
    nic: "",
    password: "",
    confirmPassword: ""
  });

  // Handle input changes
  const handleChange = (e) => {
    setFormData({ ...formData, [e.target.id]: e.target.value });
  };

  // Handle form submit
  const handleSubmit = async (e) => {
    e.preventDefault();

    if (formData.password !== formData.confirmPassword) {
      alert("Passwords do not match!");
      return;
    }

    try {
      const response = await axios.post("http://localhost:8080/api/auth/register", formData);
      alert("✅ Registration successful! Welcome " + response.data.firstName);
    } catch (error) {
      console.error(error);
      alert("❌ Registration failed!");
    }
  };

  return (
    <div className={styles.registerPageContainer}>
      {/* Left Side */}
      <div className={styles.registerPageLeft}>
        <div>
          <h1>Join the Citizen Portal</h1>
          <p>
            Register to submit complaints, track progress, and stay connected
            with public services that matter to you.
          </p>
        </div>
      </div>

      {/* Right Side */}
      <div className={styles.registerPageRight}>
        <div className={styles.registerPageBox}>
          <h2>Register</h2>
          <form className={styles.registerPageForm} onSubmit={handleSubmit}>
            <div className={styles.registerPageFormGroup}>
              <label htmlFor="firstName">First Name</label>
              <input type="text" id="firstName" value={formData.firstName} onChange={handleChange} required />
            </div>
            <div className={styles.registerPageFormGroup}>
              <label htmlFor="lastName">Last Name</label>
              <input type="text" id="lastName" value={formData.lastName} onChange={handleChange} required />
            </div>
            <div className={styles.registerPageFormGroup}>
              <label htmlFor="email">Email</label>
              <input type="email" id="email" value={formData.email} onChange={handleChange} required />
            </div>
            <div className={styles.registerPageFormGroup}>
              <label htmlFor="phone">Phone</label>
              <input type="text" id="phone" value={formData.phone} onChange={handleChange} required />
            </div>
            <div className={styles.registerPageFormGroup}>
              <label htmlFor="dob">Date of Birth</label>
              <input type="date" id="dob" value={formData.dob} onChange={handleChange} required />
            </div>
            <div className={styles.registerPageFormGroup}>
              <label htmlFor="nic">National ID</label>
              <input type="text" id="nic" value={formData.nic} onChange={handleChange} required />
            </div>
            <div className={styles.registerPageFormGroup}>
              <label htmlFor="password">Password</label>
              <input type="password" id="password" value={formData.password} onChange={handleChange} required />
            </div>
            <div className={styles.registerPageFormGroup}>
              <label htmlFor="confirmPassword">Confirm Password</label>
              <input type="password" id="confirmPassword" value={formData.confirmPassword} onChange={handleChange} required />
            </div>
            <div className={`${styles.registerPageFormGroup} ${styles.registerPageFullWidth}`}>
              <button className={styles.registerPageButton} type="submit">
                Register
              </button>
            </div>
            <div className={styles.registerPageExtraLinks}>
              <p>
                Already have an account? <a href="/login">Login</a>
              </p>
            </div>
          </form>
        </div>
      </div>
    </div>
  );
};

export default Register;
